public Object packetColored(boolean far, Location loc,
                                Color color) {
        int r = color.getRed();
        if (r == 0) r = 1;
        return packet(far,
                loc.getX(),     loc.getY(),                 loc.getZ(),
                r / 255D,       color.getGreen() / 255D,    color.getBlue() / 255D,
                1D, 0);
    }
